import React from 'react'

function UpdateBalance() {
    return (
        <div>
            Hello 
            {/* UserName: <input type="text" name="username" value={this.state.username} placeholder='Enter username' onChange={this.handleChange}/> */}
            <button className="btn btn-success" onClick={() => this.props.history.push("/updateBalance")}>Deposit</button><br />
            <button className="btn btn-success" onClick={() => this.props.history.push("/updateBalance")}>Withdrwa</button><br />
            <button className="btn btn-success" onClick={() => this.props.history.push("/updateBalance")}>Save</button>
        </div>
    )
}

export default UpdateBalance
